import React from "react";
import { useNavigate } from "react-router-dom";
import "./LandingPage.css";

const LandingPage = () => {
  const navigate = useNavigate();

  const handleNavigation = (userType) => {
    if (userType === "student") {
      navigate("/login/student");
    } else if (userType === "professor") {
      navigate("/login/professor");
    }
  };

  const generateTileRows = () => {
    return Array(5) // Generate 5 rows of tiles
      .fill(0)
      .map((_, rowIndex) => {
        const tileCount = Math.floor(Math.random() * (10 - 4 + 1)) + 4; // Random count between 4 and 10
        return (
          <div key={rowIndex} className="tile-row">
            {Array(tileCount)
              .fill(0)
              .map((_, tileIndex) => (
                <div
                  key={tileIndex}
                  className="tile"
                  style={{
                    backgroundColor: `hsl(${Math.random() * 360}, 70%, 80%)`, // Random pastel colors
                  }}
                ></div>
              ))}
          </div>
        );
      });
  };

  return (
    <div className="landing-page">
      {/* Upper Section with Random Tile Rows */}
      <div className="tiles-section">{generateTileRows()}</div>

      {/* Lower Section */}
      <div className="lower-section">
        <h1 className="heading">I am</h1>
        <div className="button-group">
          <button
            className="user-button"
            onClick={() => handleNavigation("student")}
          >
            Student
          </button>
          <button
            className="user-button"
            onClick={() => handleNavigation("professor")}
          >
            Professor
          </button>
        </div>
        <p className="register-link">
          Don't have an account?{" "}
          <span
            onClick={() => navigate("/register")}
            className="register-link-text"
          >
            Register here!
          </span>
        </p>
      </div>
    </div>
  );
};

export default LandingPage;
